import React from 'react';
import CarParkingService from '../services/CarParkingService';

class CarParkingComponent extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            carparking:[]
        }
    }

    componentDidMount(){
        CarParkingService.getsCarParking().then((response) =>{
            this.setState({carparking: response.data})
        });
    }

    render (){
        return (
            <div>
                <h1 className="text-center">Check Your Car </h1>
                <input type="text">
                </input>
                <table className="table table-striped ">
                    <thead> 
                        <tr>
                            <td>STT</td>
                            <td>Mã đỗ xe</td>
                            <td>Loại xe</td>
                            <td>Giá</td>
                            <td>Vị trí</td>
                            <td>Thời gian vào</td>
                            <td>Thời gian ra</td>
                            <td>Tổng thời gian</td>
                            <td>Tổng tiền</td>
                            <td>Trạng thái</td>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.carparking.map(
                            carparking=>
                            <tr key={carparking.id}>
                                <td>{carparking.id}</td>
                                <td>{carparking.parking_code}</td>
                                <td>{carparking.vechile_cat_id}</td>
                                <td>{carparking.rate_id}</td>
                                <td>{carparking.slot_id}</td>
                                <td>{carparking.in_time}</td>
                                <td>{carparking.out_time}</td>
                                <td>{carparking.total_time}</td>
                                <td>{carparking.paid_status}</td>

                            </tr>
                            )
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}
export default CarParkingComponent
